import React from "react";
class Cart extends React.Component {
  render() {
    return (
      <div>
        <div className="md:flex">
          <div className="flex">
            <span className="text-2xl font-bold">My Cart</span>
            <span className="text-sm text-blue-700">3 items</span>
          </div>
          <div className="text-yellow-500 border border-yellow-500 text-xs font-semibold">
            CONTINUE SHOPPING
          </div>
        </div>
      </div>
    );
  }
}

export default Cart;
